import React, { Component } from 'react'
import { Input, Button, List, Typography, Divider } from 'antd';

TodoListUI
class TodoListUI extends Component {
    render() {
        return (
        <div style={{ marginTop: '10px', marginLeft: '10px' }}>
            <div> HELLO </div>
            <Input
                value={this.props.inputValue}
                placeholder=""
                style={{ width: '300px' }}
                onChange={this.props.handleInputChage}
            />
            <Button
                type="primary"
                onClick={this.props.handleBtnClk}
            >Primary Button</Button>

            <Divider orientation="left">Default Size</Divider>
            <List
                header={<div>Header</div>}
                footer={<div>Footer</div>}
                bordered
                dataSource={this.props.list}
                renderItem={(item, index) => (
                    <List.Item
                        onClick={this.props.handleDelClk.bind(this, index)}
                    >
                        <Typography.Text mark> list

                    </Typography.Text> {item}
                    </List.Item>
                )}
            />
        </div>)

    }
}

export default TodoListUI
